import { Route,Routes } from 'react-router-dom';
import './App.css';
import IndexPage from './pages/IndexPage';
import LoginPage from './pages/LoginPage';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/" element={<IndexPage />} />
      <Route path="/login" element={<LoginPage/>}/>
    </Routes>
    </Router>

  );
}

export default App;
